INSERT INTO `micro_templates` (`id`, `alias`, `template`, `created`, `modified`, `tag_name`) VALUES 
(1, 'vertical-menu', '<div id="menuwrapper">\r\n<ul id="primary-nav">\r\n{foreach from=$content_list item=node}\r\n	<li\r\n	{if $node.alias == $content_alias}\r\n		class="active"\r\n	{/if}\r\n	><a href="{$node.url}">{$node.name}</a></li>\r\n{/foreach}\r\n</ul>\r\n<div class="clearb"></div>\r\n</div>', '2007-07-28 17:08:06', '2007-09-02 22:14:50', 'content_listing'),
(3, 'information-links', '<ul class="information">\r\n{foreach from=$content_list item=node}\r\n	<li\r\n	{if $node.alias == $content_alias}\r\n		class="active"\r\n	{/if}\r\n	><a href="{$node.url}">{$node.name}</a></li>\r\n{/foreach}\r\n</ul>\r\n<div class="clearb"></div>', '2007-07-30 15:42:21', '2007-09-02 22:26:58', 'content_listing'),
(5, 'shopping-cart', '<div class="cart">\r\n	<table style="width:100%;">\r\n		<tr>	\r\n			<th> </th>\r\n			<th>{lang}product{/lang}</th>\r\n			<th>{lang}price-ea{/lang}</th>\r\n			<th>{lang}qty{/lang}</th>\r\n			<th>{lang}total{/lang}</th>\r\n		</tr>\r\n				\r\n		{foreach from=$order_items item=product}			\r\n			<tr>\r\n				<td><a href="/cart/remove_product/{$product.id}" class="remove">x</a></td>\r\n				<td><a href="{$product.link}">{$product.name}</a></td>\r\n				<td>{$product.price}</td>\r\n				<td>{$product.qty}</td>\r\n				<td>{$product.line_total}</td>\r\n			</tr>				\r\n		{foreachelse}	\r\n			<tr>\r\n				<td colspan="5">{lang}no-cart-items{/lang}</td>\r\n			</tr>\r\n		{/foreach}				\r\n				\r\n		<tr class="cart_total">\r\n			<td colspan="5">{lang}total{/lang} {$order_total}</td>\r\n		</tr>\r\n	</table>\r\n	<a class="checkout" href="{$checkout_link}">{lang}checkout{/lang}</a>\r\n</div>', '2007-07-31 14:56:59', '2007-09-02 22:26:49', 'shopping_cart'),
(6, 'currency-box', '<div class="info_box">\r\n	<div class="box_heading">{lang}currency{/lang}</div>\r\n	<div class="box_content">\r\n		<form action="/currencies/pick_currency/" method="post">\r\n		<select name="currency_picker">\r\n	 	{foreach from=$currencies item=currency}\r\n	<option value="{$currency.id}" {if $currency.id == $smarty.session.Customer.currency_id}selected="selected"{/if}>{$currency.name}</option>\r\n		{/foreach}\r\n		</select>\r\n		<input type="submit" value="Go" />\r\n		</form>\r\n	</div>\r\n</div>', '2007-08-01 14:42:02', '2007-09-06 16:43:19', 'currency_box'),
(8, 'cart-content-box', '<div id="cart">\r\n	<a href="{$cart_link}" class="shopping_cart_link">{lang}shopping-cart{/lang}</a>\r\n	<ul class="cart_contents">\r\n		{foreach from=$order_items item=product}\r\n			<li>{$product.qty} x <a href="{$product.url}">{$product.name}</a></li>\r\n		{/foreach}\r\n	</ul>\r\n	<ul class="cart_total">\r\n		<li>{lang}total{/lang}: {$order_total}</li>\r\n	</ul>\r\n	<a class="checkout" href="{$checkout_link}">{lang}checkout{/lang}</a>\r\n</div>', '2007-08-09 16:27:09', '2007-09-02 22:26:30', 'shopping_cart'),
(9, 'payment-view-cart', '<div class="cart">\r\n	<table style="width:100%;">\r\n		<tr>	\r\n			<th> </th>\r\n			<th>{lang}product{/lang}</th>\r\n			<th>{lang}price-ea{/lang}</th>\r\n			<th>{lang}qty{/lang}</th>\r\n			<th>{lang}total{/lang}</th>\r\n		</tr>\r\n				\r\n		{foreach from=$order_items item=product}			\r\n			<tr>\r\n				<td><a href="/cart/remove_product/{$product.id}" class="remove">x</a></td>\r\n				<td><a href="{$product.link}">{$product.name}</a></td>\r\n				<td>{$product.price}</td>\r\n				<td>{$product.qty}</td>\r\n				<td>{$product.line_total}</td>\r\n			</tr>				\r\n		{foreachelse}	\r\n			<tr>\r\n				<td colspan="5">{lang}no-cart-items{/lang}</td>\r\n			</tr>\r\n		{/foreach}				\r\n				\r\n		<tr class="cart_total">\r\n			<td colspan="5">\r\n				{lang}shipping{/lang}: {$shipping_total}<br />\r\n				<strong>{lang}total{/lang}:</strong> {$order_total}\r\n			</td>\r\n		</tr>\r\n	</table>\r\n</div>', '2007-08-10 13:09:25', '2007-09-02 22:25:57', 'shopping_cart');
