INSERT INTO `stylesheets` (`id`, `active`, `name`, `alias`, `stylesheet`, `stylesheet_media_type_id`, `created`, `modified`) VALUES 
(15, 1, 'Default Layout', 'default-home-page-layout', '* {\r\n    padding:0;\r\n    margin:0;\r\n}\r\na img {\r\n    border:0;\r\n}\r\nbody {\r\n    background-color:#EEE;\r\n}\r\n#layout {\r\n    width:900px;\r\n    margin:auto;\r\n    background-color:#FFFFFF;\r\n\r\n}\r\n#header h1 a {\r\n	display:block;\r\n	padding:15px 10px;\r\n}\r\n#navigation {\r\n	background-color:#0C3887;\r\n	text-align:center;\r\n	height:40px;\r\n	overflow:hidden;\r\n}\r\n#content {\r\n	width:60%;\r\n	float:left;\r\n}\r\n#inner-content {\r\n	padding:30px 40px 100px 40px;\r\n}\r\n#left_sidebar {\r\n	width:20%;\r\n	float:left;\r\n}\r\n#left_sidebar #primary-nav {\r\n	list-style-type:none;\r\n	border-bottom:1px solid #666666;\r\n	border-right:1px solid #666666;\r\n	background-color:#EEF2F3;\r\n}\r\n#left_sidebar #primary-nav a {\r\n	display:block;\r\n	padding:4px 15px;\r\n	color:#333333;\r\n	font-weight:bold;\r\n}\r\n#left_sidebar #primary-nav a:hover {\r\n	background-color:#FFFFFF;\r\n}\r\n#left_sidebar #primary-nav .active a {\r\n	background-color:#FF9900;\r\n}\r\n#right_sidebar {\r\n	float:right;\r\n	width:20%;\r\n	padding-bottom:100px;\r\n}\r\n.clearb {\r\n	clear:both;\r\n}\r\n#footer {\r\n	background-color:#0C3887;\r\n	text-align:center;\r\n	height:40px;\r\n	overflow:hidden;\r\n	font-size:11px;\r\n}\r\n#footer a {\r\n	padding:0 6px;\r\n	color:#FFFFFF;\r\n}\r\n#footer a:hover {\r\n	text-decoration:underline;\r\n}\r\n#footer ul {\r\n	padding:11px 0;\r\n	list-style-type:none;\r\n}\r\n#footer ul li {\r\n	display:inline;\r\n}\r\n#powered_by {\r\n	text-align:center;\r\n	background-color:#EEEEEE;\r\n}\r\n#powered_by a {\r\n	display:block;\r\n	padding-top:5px;\r\n	font-size:11px;\r\n	color:#000000;\r\n}\r\n/**** Shopping Cart Box ****/\r\n.shopping_cart_link {\r\n	display:block;\r\n	padding:5px 8px 5px 35px;\r\n	background-image: url(/img/icon_cart.png);\r\n	background-repeat:no-repeat;\r\n	background-position:4px 2px;\r\n	background-color:#B02B2C;\r\n	color:#FFFFFF;\r\n	font-weight:bold;\r\n}\r\nul.cart_total {\r\n	list-style-type:none;\r\n	font-weight:bold;\r\n	text-align:right;\r\n	padding:0 10px;\r\n}\r\nul.cart_total li {\r\n	padding:2px 0;\r\n	border-top:1px solid #333333;\r\n}\r\nul.cart_contents {\r\n	padding:6px;\r\n	list-style-type:none;\r\n}\r\nul.cart_contents a {\r\n	color:#000000;\r\n}\r\na.checkout {\r\n	display:block;\r\n	font-weight:bold;\r\n	padding:5px 8px;\r\n	background-color:#B02B2C;\r\n	border-top:1px solid #FAFAFA;\r\n	color:#FFFFFF;\r\n}\r\n#cart {\r\n	margin-top:10px;\r\n	margin-right:10px;\r\n	background-color:#FFFFFF;\r\n	border:1px solid #333333;\r\n}\r\n#cart a:hover {\r\n	text-decoration:underline;\r\n}\r\n/**** End Shopping Cart Box ****/\r\n\r\n\r\n/**** Shopping Cart Page ****/\r\n.cart {\r\n	background-color:#FFFFFF;\r\n	border:1px solid #333333;\r\n}\r\n.cart tr th{\r\n	text-align:left;\r\n	text-decoration:none;\r\n}\r\n.cart tr th,\r\n.cart tr td {\r\n	padding:3px 5px;\r\n}\r\n.cart tr.cart_total td {\r\n	text-align:right;\r\n	padding-right:40px;\r\n	padding-left:40px;\r\n	border-top:1px solid #333333;	\r\n}\r\n.cart a {\r\n	color:#000000;\r\n}\r\n.cart a.checkout {\r\n	color:#FFFFFF;\r\n}\r\n/**** End Shopping Cart Page ****/\r\n\r\n\r\n/**** Product/Category Listing ****/\r\n\r\n.content_listing {\r\n	list-style-type:none;\r\n	text-align:center;\r\n}\r\n.content_listing a {\r\n	color:#000000;\r\n}\r\n.content_listing li {\r\n	display:block;\r\n	float:left;\r\n	padding:14px;\r\n	margin:12px;\r\n	border:1px solid #CCCCCC;\r\n}\r\n/**** End Product/Category Listing ****/\r\n\r\n/**** Info Boxes ****/\r\n.info_box {\r\n	background-color:#FFFFFF;\r\n	border:1px solid #333333;\r\n	margin-top:10px;\r\n	margin-right:10px;\r\n}\r\n.info_box .box_heading {\r\n	font-weight:bold;\r\n	padding:5px 8px;\r\n	background-color:#B02B2C;\r\n	color:#FFFFFF;\r\n}\r\n.info_box .box_content {\r\n	padding:6px;\r\n}	\r\n/**** End Info Boxes ****/\r\n\r\ndiv.add_to_cart input {\r\n	background-image:url(/img/button_bg.jpg);\r\n	background-repeat:repeat-x;\r\n	border:1px solid #333333;\r\n	background-color:#FF9900;\r\n	color:#FFFFFF;\r\n	font-weight:bold;\r\n	display:block;\r\n	padding:4px 28px 4px 28px;\r\n	white-space:nowrap;\r\n}\r\n#sms_checkout_button {\r\n	background-image:url(/img/button_bg.jpg);\r\n	background-repeat:repeat-x;\r\n	border:1px solid #333333;\r\n	background-color:#FF9900;\r\n	color:#333333;\r\n	font-weight:bold;	\r\n	float:right;\r\n	margin:1em 0pt;\r\n	padding:5px;\r\n	width:10em;\r\n	font-size:14px;\r\n}', 0, '2007-07-14 18:44:00', '2007-08-30 14:49:00'),
(18, 1, 'Default Typography', 'default-typography', '* {\r\n    font-size:12px;\r\n    font-family: Arial, Helvetica, sans-serif;\r\n}\r\na {\r\ntext-decoration:none;\r\n}\r\nh1 a {\r\ncolor:#000000;\r\nfont-size:24px;\r\n}\r\nh2 {\r\nfont-size:16px;\r\n}\r\np {\r\nfont-size:12px;\r\nline-height:15px;\r\nmargin-bottom:20px;\r\n}\r\n#footer a {\r\nfont-size:11px;\r\n}\r\na.remove {\r\nfont-weight:bold;\r\ncolor:FF0000;\r\n}', 0, '2007-07-24 14:15:32', '2007-08-02 13:47:12'),
(20, 1, 'Default Product Details', 'default-product-details', '#product_details_left {\r\n	float:left;\r\n	width:70%;\r\n}\r\n#product_details_right {\r\n	float:right;\r\n	width:30%;\r\n}\r\n.product_price {\r\n	text-align:center;\r\n	font-weight:bold;\r\n	font-size:16px;\r\n	margin:10px auto;\r\n}\r\n.content_images {\r\n	text-align:center;\r\n	list-style-type:none;\r\n}\r\n.product_quantity {\r\n	width:25px;\r\n	font-weight:bold;\r\n	text-align:center;\r\n}', 0, '2007-07-30 16:28:26', '2007-08-15 15:09:34'),
(21, 1, 'Default Checkout', 'default-checkout', '/* Element Styling */\r\n.css_form hr,\r\n#checkout hr {\r\n	margin:10px 0;\r\n	display:none;\r\n}\r\n.css_form div,\r\n#checkout div {\r\n	padding:15px;\r\n	background:#E5ECF2;\r\n	margin-bottom:25px;	\r\n}\r\n.css_form div div,\r\n#checkout div div {\r\n	padding:0;\r\n	margin-bottom:10px;\r\n	background-color:transparent;\r\n}\r\n/* End Element Styling */\r\n\r\n\r\n/* Form Styling */\r\n.css_form label,\r\n#checkout label {\r\n	display:block;\r\n	float:left;\r\n	width:150px;\r\n}\r\n.css_form input,\r\n#checkout input,\r\n.css_form textarea,\r\n#checkout textarea {\r\n	width:180px;\r\n}	\r\n#checkout #payment_method label,\r\n#checkout #shipping_method label {\r\n	display:inline;\r\n	float:none;\r\n	width:auto;\r\n}\r\n#checkout #payment_method input,\r\n#checkout #shipping_method input {\r\n	width:auto;\r\n}\r\noption {\r\n	padding:0pt 1em 0pt 4px;\r\n}\r\n/* End Form Styling */', 0, '2007-08-10 11:07:11', '2007-08-13 15:35:53');
