(89, 0, 0, 1, 'Default Theme', '', '2007-07-26 16:02:41', '2007-09-12 17:46:19'),
(90, 89, 1, 0, 'Layout', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n	{* This tag links all attached stylesheets to the current template *}\r\n	{* You can link more stylesheets to this theme by clicking on the small css icon. *}\r\n	{stylesheet}\r\n\r\n	{* Outputs the global metadata found in Configuration => Store Settings *}\r\n	{metadata}\r\n<title>\r\n	{* site_name: Outputs the site name found in Configuration => Store Settings *}\r\n	{* content_name: Outputs the name of the current content page *}\r\n	{site_name} - {page_name}\r\n</title>\r\n<meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n</head>\r\n<body>\r\n	{admin_area_link}\r\n	<div id="layout">\r\n		<div id="header">\r\n			<h1><a href="/">{site_name}</a></h1>\r\n		</div>\r\n		<div id="navigation"> </div>\r\n		<div id="left_sidebar">\r\n			 {content_listing template=''vertical-menu'' parent=''0'' type=''product,category''}\r\n		</div>\r\n		<div id="content">\r\n			{admin_edit_link}\r\n			<div id="inner-content">\r\n				<h2>{page_name}</h2>\r\n				{content}\r\n			</div>\r\n			{admin_edit_link}\r\n		</div>\r\n		<div id="right_sidebar">\r\n			{shopping_cart template=''cart-content-box''}\r\n			{language_box}\r\n			{currency_box}\r\n		</div>\r\n		<div class="clearb"></div>	\r\n		<div id="footer">\r\n			{content_listing template=''information-links'' parent=''44''}\r\n		</div>\r\n		<div id="powered_by">\r\n			{global_content alias=''footer''}\r\n		</div>\r\n	</div>\r\n</body>\r\n</html>', '2007-07-26 16:02:41', '2007-09-11 17:55:25'),
(91, 89, 2, 0, 'Content Page', '{description}\r\n', '2007-07-26 16:02:41', '2007-07-29 21:37:54'),
(92, 89, 3, 0, 'Product Info', '<div id="product_details_left">\r\n	{description}\r\n</div>\r\n<div id="product_details_right">\r\n	<div class="product_images">{content_images number=''1''}</div>\r\n	{product_form}\r\n		<div class="product_price">{product_quantity} @ {product_price}</div>\r\n		<div class="add_to_cart">{purchase_button id=$content_id}</div>\r\n	{/product_form}\r\n	{module alias=''reviews'' action=''link''}\r\n</div>\r\n<div style="clear:both;"></div>', '2007-07-26 16:02:41', '2007-08-20 09:29:00'),
(93, 89, 4, 0, 'Category Info', '{description}\r\n\r\n{if $sub_count.categories > 0}\r\n	<h3>{lang}sub-category-list{/lang}</h3>\r\n	<div class="content_listing">\r\n		{content_listing  parent=$content_id type=''category''}\r\n	</div>\r\n{/if}\r\n\r\n{if $sub_count.products > 0}\r\n	<h3>{lang}sub-product-list{/lang}</h3>\r\n	<div class="content_listing">\r\n		{content_listing parent=$content_id type=''product''}\r\n	</div>\r\n{/if}', '2007-07-26 16:02:41', '2007-08-30 14:49:18'),
(94, 0, 0, 0, 'Minimal Template', '', '2007-08-28 16:17:22', '2007-08-28 16:17:22'),
(95, 94, 1, 0, 'Layout', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n	{stylesheet}\r\n	{metadata}\r\n<title>\r\n	{site_name} - {page_name}\r\n</title>\r\n<meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n</head>\r\n<body>\r\n	<div id="layout">\r\n		<div id="header">\r\n			<h1><a href="/">{site_name}</a></h1>\r\n		</div>\r\n		<div id="navigation"> </div>\r\n		<div id="left_sidebar">\r\n			 {content_listing template=''vertical-menu'' parent=''0'' type=''product,category''}\r\n		</div>\r\n		<div id="content">\r\n			{admin_edit_link}\r\n			<div id="inner-content">\r\n				<h2>{page_name}</h2>\r\n				{content}\r\n			</div>\r\n			{admin_edit_link}\r\n		</div>\r\n		<div id="right_sidebar">\r\n			{shopping_cart template=''cart-content-box''}\r\n			{language_box}\r\n			{currency_box}\r\n		</div>\r\n		<div class="clearb"></div>	\r\n		<div id="footer">\r\n			{content_listing template=''information-links'' parent=''44''}\r\n		</div>\r\n		<div id="powered_by">\r\n			{global_content alias=''footer''}\r\n		</div>\r\n	</div>\r\n</body>\r\n</html>', '2007-08-28 16:17:22', '2007-08-28 16:17:22'),
(96, 94, 2, 0, 'Content Page', '{description}', '2007-08-28 16:17:22', '2007-08-28 16:17:22'),
(97, 94, 3, 0, 'Product Info', '<div id="product_details_left">\r\n	{description}\r\n</div>\r\n<div id="product_details_right">\r\n	<div class="product_images">{content_images number=''1''}</div>\r\n	{product_form}\r\n		<div class="product_price">{product_quantity} @ {product_price}</div>\r\n		<div class="add_to_cart">{purchase_button id=$content_id}</div>\r\n	{/product_form}\r\n</div>\r\n<div style="clear:both;"></div>', '2007-08-28 16:17:23', '2007-08-28 16:17:23'),
